import { __decorate } from "tslib";
import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { environment } from 'src/environments/environment';
let AppliedJobsService = class AppliedJobsService {
    constructor(http) {
        this.http = http;
        this.baseUrl = environment.apiUrl;
    }
    getAllAppliedJobs(candidateId) {
        return this.http.get(`${this.baseUrl}/candidate/${candidateId}/applications`);
    }
    getEmployer(employerId) {
        return this.http.get(`${this.baseUrl}/employer/${employerId}`);
    }
    getJob(jobId) {
        return this.http.get(`${this.baseUrl}/jobs/${jobId}`);
    }
    getCandidate(candidateId) {
        return this.http.get(`${this.baseUrl}/candidate/${candidateId}`);
    }
};
